class OrderListComponent {
    constructor(router, order, EncrDecr, Cust, users, userservice) {
        this.router = router;
        this.order = order;
        this.EncrDecr = EncrDecr;
        this.Cust = Cust;
        this.users = users;
        this.userservice = userservice;
        this.mySelection = [];
    }
    ngOnInit() {
        this.users.userLoggedIn().subscribe((user) => {
            console.log(user);
            this.user = user.result;
            this.userservice.getrolebyid(user.result.role).subscribe((data) => {
                console.log(data.result[0], '---------->Roledata');
                this.userPermission = data.result[0];
            });
        });
        this.getallpo();
        localStorage.setItem('allotment', '');
    }
    getallpo() {
        this.order.getallpo().subscribe((data) => {
            console.log(data.result);
            this.podata = data.result;
        });
        this.Cust.getcustomer().subscribe((data) => {
            // console.log(data)
            this.Customers = data.result;
        });
    }
    handleEdit(id) {
        console.log('edit clicked ' + id);
        this.router.navigateByUrl('/edit-contact', { state: { id } });
    }
    getAllotment(POid, materialAllot, weight) {
        console.log(POid, materialAllot, weight);
        let allot = { POid: POid, materialAllot: materialAllot, weight: weight };
        // var encrypted = this.EncrDecr.set(allot);
        // console.log(encrypted)
        localStorage.setItem('allotment', JSON.stringify(allot));
        this.router.navigate(['./order-allotment', POid]);
    }
    convertintonumber(num) {
        return parseFloat(num);
    }
}
